    };

    return (
        <div className="App">
            <h1>Online Code Compiler</h1>
            <textarea
                rows={20}
                cols={80}
                value={code}
                onChange={(e) => setCode(e.target.value)}
            ></textarea>
            <br />
            <button onClick={handleSubmit}>submit</button>
        </div>
    );
}

export default App;
